import React from 'react';
import DataSet from './DataSet';

const App = () => {
  const sampleData = [
    { id: 3, name: 'Item 3', value: 'Value 3' },
    { id: 4, name: 'Item 4', value: 'Value 4' },
    { id: 5, name: 'Item 5', value: 'Value 5' },
    { id: 6, name: 'Item 6', value: 'Value 6' },
  ];

  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: '0 auto' }}>
      <h1 style={{ textAlign: 'center' }}>DataSet Component</h1>
      <DataSet 
        data={sampleData}
        renderHeader={(header) => header.toUpperCase()}
        renderCell={(item, header) => item[header]}
      />
    </div>
  );
};

export default App;
